import { useState, useEffect } from "react";

export interface Colors {
    id: number;
    title: string;
    userName: string;
    numViews: number;
    numVotes: number;
    numComments: number;
    numHearts: number;
    rank: number;
    dateCreated: string;
    hex: string;
    rgb: Rgb;
    hsv: Hsv;
    description: string;
    url: string;
    imageUrl: string;
    badgeUrl: string;
    apiUrl: string;
}
export interface Rgb {
    red: number;
    green: number;
    blue: number;
}
export interface Hsv {
    hue: number;
    saturation: number;
    value: number;
}

const URL = 'http://localhost:8080/colors';

function FetchData() {

    const [data, setData] = useState<Colors[]>([]);

    useEffect(() => {

        const fetchData = async () => {

            const res = await fetch(URL);
            const result: Colors[] = await res.json();
            console.log(result);
            setData(result);
        }
        fetchData();
    }, []);

    return (
        <div>
            {data.map(color => (
                <div key={color.id}>
                    <table border={1}>
                        <thead>
                            <th>ID</th>
                            <th>Title</th>
                            <th>Username</th>
                            <th>Views</th>
                            <th>Votes</th>
                            <th>Comments</th>
                            <th>Hearts</th>
                            <th>Rank</th>
                            <th>Date Created</th>
                            <th>Hex</th>
                            <th>RGB</th>
                            <th>HSV</th>
                            <th>Description</th>
                            <th>URL</th>
                            <th>ImageURL</th>
                            <th>BadgeURL</th>
                            <th>APIURL</th>
                        </thead>
                        <tbody>
                            <td>{color.id}</td>
                            <td>{color.title}</td>
                            <td>{color.userName}</td>
                            <td>{color.numViews}</td>
                            <td>{color.numVotes}</td>
                            <td>{color.numComments}</td>
                            <td>{color.numHearts}</td>
                            <td>{color.rank}</td>
                            <td>{color.dateCreated}</td>
                            <td>{color.hex}</td>
                            <td>{`rgb(${color.rgb.red}, ${color.rgb.green}, ${color.rgb.blue})`}</td>
                            <td>{`hue: ${color.hsv.hue}, saturation: ${color.hsv.saturation}, value: ${color.hsv.value}`}</td>
                            <td>{color.description}</td>
                            <td><a href={color.url} target="_blank" rel="noopener noreferrer">Link</a></td>
                            <td><img src={color.imageUrl} alt={color.title} width={50} height={50} /></td>
                            <td><a href={color.badgeUrl} target="_blank" rel="noopener noreferrer">Badge</a></td>
                            <td><a href={color.apiUrl} target="_blank" rel="noopener noreferrer">API</a></td>
                        </tbody>
                    </table>
                </div>
            ))}
        </div>
    );
}

export default FetchData;
